* White Blood Cells (WBC) ≥3.0×10⁹/L;
* Absolute Neutrophil Count (ANC) ≥1.5×10⁹/L;
* Lymphocytes ≥0.8×10⁹/L;
* Platelets (PLT) ≥90×10⁹/L;
* Hemoglobin (HGB)≥90 g/L (\*transfusion and erythropoietin use are permitted\*); If active bleeding or other ongoing conditions (e.g., hemolysis, bone marrow infiltration) lead to increased red blood cell destruction/impaired production, requiring repeated transfusions or erythrocyte therapies, the patient's eligibility must be discussed with the \*\*sponsor\*\* based on clinical context prior to enrollment.
* Liver function (within 7 days) :
* Total Bilirubin (TBIL) ≤1.5× upper limit of normal (ULN);
* ALT/AST≤2.5× ULN;
* Kidney function (within 7 days) :
* Serum Creatinine (Cr)≤1.5× ULN or Creatinine Clearance (CrCl) ≥30 mL/min (calculated by Cockcroft-Gault formula) Cockcroft-Gault formula);
* Coagulation function (within 7 days) :
* International Normalized Ratio (INR) or Prothrombin Time (PT)≤1.5× ULN;
* Activated Partial Thromboplastin Time (APTT) ≤1.5× ULN;
* Toxicities from prior systemic therapy must have recovered to≤ Grade 1 or baseline levels prior to the first dose (except for alopecia);
* Males of reproductive potential and females of childbearing potential must agree to use highly effective contraception from the time of signing the informed consent form until 180 days after the last dose of MT027 Cell Infusion. Females of childbearing potential include: Premenopausal women .Women within 2 years postmenopausal.

Exclusion Criteria:

* Known hypersensitivity to the investigational product or its excipients;
* Other malignancies within 5 years (except cured carcinoma in situ of cervix/breast/prostate/thyroid/skin \[basal cell/squamous cell carcinoma\]);
* Contraindications to peritoneal puncture or investigator-determined unsuitability for intraperitoneal therapy;
* MSI-H (microsatellite instability-high)/dMMR (mismatch repair deficient) colorectal cancer patients without prior immunotherapy;
* Portal vein thrombosis confirmed by imaging;
* Bowel obstruction within 4 weeks prior to dosing;
* Peritoneal adhesions/jelly-like ascites (e.g., pseudomyxoma peritonei) limiting drug diffusion;
* Major surgery (except intraperitoneal port placement) or abdominal radiotherapy within 4 weeks before first dose;
* High-dose systemic corticosteroids (prednisone ≥20 mg/day) for \>14 days within 4 weeks prior to treatment (topical/inhaled steroids allowed);
* Participation in other clinical trials within 4 weeks prior to screening;
* Prior therapy targeting same pathway (antibody/ADC/cell therapy);
* Severe autoimmune diseases (e.g., lupus, rheumatoid arthritis);
* Recipients of allogeneic tissue/organ transplants;
* Live vaccination within 4 weeks before cell therapy or planned during study;
* Active infections: HBV (HBsAg+ with detectable DNA)、 HCV (Ab+ except RNA-undetectable) 、 HIV+ 、Syphilis (TPPA+) 、Active EBV/CMV infection;
* Active systemic infections, coagulopathy, or other significant comorbidities;
* Organ dysfunction: Cardiac: NYHA Class ≥III ；Hepatic: Child-Pugh C； Renal: CKD Stage ≥4 ；Pulmonary: Severe respiratory failure;
* Pregnancy/Lactation;
* Investigator-determined unsuitability based on clinical/laboratory findings.

Inclusion Criteria:

1. Voluntarily participate in this study and provide a signed and dated written informed consent form prior to any study-specific procedures, sampling or analyses.
2. Be aged 18 years or older, with no limitation on gender.
3. Have a definite diagnosis of malignant tumor confirmed by pathology and/or histology (and provide complete pathological report information), and have been verified by biopsy, cytology, imaging examinations, etc. or have had previous confirmation of brain, meninges, spinal cord metastases, including lung cancer, breast cancer, colorectal cancer, melanoma, renal cell carcinoma, etc. Other solid tumor CNS metastases without standard treatment as judged by the investigator can also be considered for enrollment.
4. The expected survival period is at least 3 months.
5. The Karnofsky Performance Scale (KPS) score is ≥ 70 points. -

Exclusion Criteria:

1. Known to be allergic to the investigational drug or its excipient components;
2. Those with central nervous system metastases of hematological malignancies (such as lymphoma, leukemia, etc.);
3. Those with metastases in the brainstem and high cervical spinal cord, including the midbrain, pons, medulla oblongata and C1/2 cervical spinal cord segments;
4. Those with severe insufficiency of heart, lung, liver and kidney functions; cardiac function: grade III or above according to the New York Heart Association (NYHA) criteria; liver function: grade C or above according to the Child-Pugh grading criteria; renal function: chronic kidney disease (CKD) stage 4 or above; renal insufficiency stage III or above; pulmonary function: severe respiratory failure symptoms involving other organs;
5. Pregnant or lactating women;
6. Those who are considered by the investigator to be unsuitable for participating in this clinical study due to any clinical or laboratory examination abnormalities or other reasons.

Inclusion Criteria:

1. abilities to understand and the willingness to provide written informed consent;
2. patients are ≥ 18 and ≤ 70 years old;
3. recurrent glioblastoma patients with measurable tumors. Patients have received standard care of medication, such as Gross Total Resection with concurrent Radio-chemotherapy (\~54 - 60 Gy, TMZ). Patients must either not be receiving dexamethasone or receiving ≤ 4 mg/day at the time of leukopheresis;
4. Malignant cells are PD-L1 positive confirmed by IHC;
5. karnofsky performance score (KPS) ≥ 60;
6. life expectancy \>3 months;
7. satisfactory bone marrow, liver and kidney functions as defined by the following: absolute neutrophile count ≥ 1500/mm\^3; hemoglobin \> 10 g/dL; platelets \> 100000 /mm\^3; Bilirubin \< 1.5×ULN; alanine aminotransferase (ALT) or aspartate aminotransferase (AST) \< 2.5×ULN; creatinine \< 1.5×ULN;
8. peripheral blood absolute lymphocyte count must be above 0.8×10\^9/L;
9. satisfactory heart functions;
10. patients must be willing to follow the orders of doctors;
11. women of reproductive potential (between 15 and 49 years old) must have a negative pregnancy test within 7 days of study start. Male and female patients of reproductive potential must agree to use birth control during the study and 3 months post study.

Exclusion Criteria:

1. a prior history of gliadel implantation 4 weeks before this study start or antibody based therapies;
2. HIV positive;
3. hepatitis B infection or hepatitis C infection;
4. history of autoimmune disease, or other diseases require long-term administration of steroids or immunosuppressive therapies;
5. history of allergic disease, or allergy to CAR T cells or study product excipients;
6. patients already enrolled in other clinical study;
7. patients, in the opinion of investigators, may not be eligible or not able to comply with the study.

